(1, 'સાયબર ક્રાઇમ ', NULL, 'દુલારીદેવી W/O અનિરુધ્ધ પ્રયાગ મિશ્રા ', '૫૦', NULL, 'અનટ્રેસ ', 'ભાગલપુર ', '૫ ફુટ ૧ ઇંચ ', 'ઘઉં વર્ણ ', 'પાતળો ', 'કાળા ', 'કાળી ', '-', NULL, 'હિન્દુ ', 'અભણ ', 'હાલ રહે-શાંતીનગર-૨,ધર્મ કાંટાની ગલીમાં,રાજપીપળા રોડ,કિશનભાઇ વાઘરીના મકાનમાં ભાડેથી,તા.અંક્લેશ્વર જી.ભરૂચ\nમુળ રહે-કિશનપુર,અમખોરીયા થાના-સજોર જી.ભાગલપુર,(બિહાર) ', NULL, 'પો.ઇન્સ. યુ.એલ.મોદી ', 'વારંવાર રહેવાની જગ્યાઓ', '[{\"s_no\":null,\"ps_crime_no\":\"\\u0a97\\u0ac1.\\u0ab0.\\u0aa8\\u0a82.\\u0aaa\\u0abe\\u0ab0\\u0acd\\u0a9f-\\u0aac\\u0ac0 \\u0ae7\\u0ae7\\u0aee\\u0ae8\\u0ae8\\u0ae6\\u0ae8\\u0aea\\u0ae8\\u0aeb\\u0ae6\\u0ae6\\u0ae6\\u0aea\\/\\u0ae8\\u0ae6\\u0ae8\\u0aeb\",\"sentence\":\"\\u0ab5\\u0abe\\u0ab0\\u0a82\\u0ab5\\u0abe\\u0ab0 \\u0ab0\\u0ab9\\u0ac7\\u0ab5\\u0abe\\u0aa8\\u0ac0 \\u0a9c\\u0a97\\u0acd\\u0aaf\\u0abe\\u0a93\",\"section\":\"\\u0aad\\u0abe\\u0ab0\\u0aa4\\u0ac0\\u0aaf \\u0aa8\\u0acd\\u0aaf\\u0abe\\u0aaf \\u0ab8\\u0a82\\u0ab9\\u0abf\\u0aa4\\u0abe \\u0ae8\\u0ae6\\u0ae8\\u0ae9 \\u0aa8\\u0ac0 \\u0a95.\\u0ae9\\u0ae7\\u0aee(\\u0aea),\\u0ae9\\u0ae7\\u0aef(\\u0ae8),\\u0aec\\u0ae7(\\u0ae8),\\u0ae9(\\u0aeb),\\u0aa4\\u0aa5\\u0abe \\u0a86\\u0a87.\\u0a9f\\u0ac0.\\u0a8f\\u0a95\\u0acd\\u0a9f \\u0ae8\\u0ae6\\u0ae6\\u0ae6 \\u0aa8\\u0ac0 \\u0a95.\\u0aec\\u0aec(\\u0ab8\\u0ac0),\\u0aec\\u0aec(\\u0aa1\\u0ac0) \\u0aae\\u0ac1\\u0a9c\\u0aac\",\"date\":\"2025-07-15\"},{\"s_no\":null,\"ps_crime_no\":null,\"sentence\":null,\"section\":null,\"date\":null}]', 'વારંવાર રહેવાની જગ્યાઓ', 'વારંવાર રહેવાની જગ્યાઓ', 'અનિરુધ્ધ પ્રયાગ મિશ્રા ', 'વારંવાર રહેવાની જગ્યાઓ', 'વારંવાર રહેવાની જગ્યાઓ', 'ઠગાઇ ', 'સાયબર ક્રાઇમ પો.સ્ટે. ગુ.ર.નં.પાર્ટ બી-૧૧૮૨૨૦૨૪૨૫૦૦૦૪/૨૦૨૫\nગુ.બ.તા.ટા.-તા.૦૯/૦૧/૨૦૨૫ થી તા.૨૮/૦૩/૨૦૨૫\nગુ.જા.તા.ટા.-તા.૧૩/૦૫/૨૦૨૫ ટા. ૧૮/૧૫ \nઅધિનિયમ કાયદો અને કલમ-ભારતીય ન્યાય સંહિતા ૨૦૨૩ ની ક.૩૧૮(૪),૩૧૯(૨),૬૧(૨),૩(૫),તથા આઇ.ટી.એક્ટ ૨૦૦૦ ની ક.૬૬(સી),૬૬(ડી) મુજબ\nટૂંક વિગત- તે એવી રીતે છે કે આ ગુનાના કામના આરોપીઓ (૧) વોટ્સએપ નંબર - ૮૮૬૭૯૦૬૮૩૮ ના યુઝર નામે નિશા બાસુ એ પોતાની ઓળખ MIRAE ASSET SHAREKHAN કંપનીના કર્મચારી તરીકે આપી કંપનીમાં ઇન્વેસ્ટમેન્ટ કરી પૈસા કમાવવાની તક જણાવી તથા (૨) MIRAE ASSET Customer Service ના વોટ્સએપ નંબર- ૮૧૨૧૩૮૬૩૧૯, (૩) MIRAE ASSET Customer Service ના વોટ્સએપ નંબર- ૭૦૨૨૬૫૪૧૫૦ નાઓએ પોતાનો સમાન ઇરાદો પાર પાડવા સારૂ આયોજનપુર્વક પુર્વ આયોજીત ગુનાહીત કાવતરૂ રચી  ફરીયાદીને અલગ અલગ કંપનીમાં રોકાણ કરાવી તથા IPO ખરીદ કરાવી સર્વિસ ટેક્ષ, કંપનીના કમીશન ચાર્જ, ગેરંટી મની તથા બેન્ક હેન્ડલીંગ ચાર્જ જેવા અલગ અલગ ચાર્જ અને રોકાણ બતાવી ઉપરોક્ત દર્શાવેલ તમામ બેન્ક એકાઉન્ટોમાં ફરીયાદીના રૂપીયા ભરાવી ફરીયાદીના રોકાણ કરેલા રૂપીયા પરત ન આપી કુલ રૂપીયા ૨૩,૭૭,૨૧૫/- જેટલી રકમ ટ્રાન્સફર કરાવી ઠગાઇ કરી ગુન્હો કરેલ હોય વિગેરે બાબત. ', NULL, 'સાડી', NULL, 'ચા પીવાની ', 'મોજે ૨૭,ગુરૂ સાનિધ્ય,અયોધ્યાનગર-૩,વિજલપોર ', 'આરોપી નામે દુલારીદેવી વા/ઓ અનિરુધ્ધ પ્રયાગ મિશ્રા ઉ.વ. ધંધો.છુટક મજૂરી હાલ રહે-શાંતીનગર-૨,ધર્મ કાંટાની ગલીમાં,રાજપીપળા રોડ,કિશનભાઇ વાઘરીના મકાનમાં ભાડેથી,તા.અંક્લેશ્વર જી.ભરૂચ\nહું ઉપર બતાવેલ હાલના સરનામે છેલ્લા નવેક વર્ષથી રહું છું અને છુટક મજુરીકામ કરું છું.અને મારા પતિ મને છોડીને અલગ રહે છે.મને સંતાનમાં ત્રણ બાળકો છે જેમાં સૌથી મોટો રિતેશ ઉ.વ.૨૩ જે મારી સાથે રહે છે અને ડ્રાઇવીંગ કરે છે.તેનાથી નાની તનુ મિશ્રા ઉ.વ.૨૧ જેના લગ્ન થઇ ગયેલ છે અને અમદાવાદ ખાતે રહે છે.અને સૌથી નાનો આર્યન ઉ.વ.૧૫ જે અમારા ગામ બિહાર ખાતે અમારા પરિવાર સાથે રહે છે.સને-૨૦૨૪ માં દિવાળી તહેવાર પહેલા હુ તથા મારો છોકરો આર્યન રાજસ્થાન ખાતે ગયેલા ત્યારે અમારી મુલાકાત દિનેશ નામના વ્યકતી સાથે થયેલ અને મારો દિકરો તથા આ દિનેશ બેંક એકાઉન્ટની વાત કરતા હતા અને તેઓએ એકબીજાનો મોબાઇલ નંબર લીધેલ હતો અને ત્યારબાદ ફેબ્રુઆરી-૨૦૨૫ માં મારા દિકરા આર્યને દિનેશના કહેવાથી અમોને બેંકમાં એકાઉન્ટ ખોલવા માટે અને નવા સીમકાર્ડ લેવા માટે કહેલ અને અમોને બે બેંક એકાઉન્ટના બદલામાં રૂપીયા ૧૦,૦૦૦/- આપવાની વાત કરેલી જેથી એક મારૂ એકાઉન્ટ ખોલવાનુ હોય તેમજ એક મારી માસી બબીતાબેન પાઠક જેઓને એકાઉન્ટ ખોલવા માટે મેં તેમને જણાવેલ કે હાલમાં સરકાર યોજનાનો લાભ આપે છે અને પૈસા ડાયરેકટ ખાતામાં આવે છે તેવુ કહેલ જેથી અમો ગ્રાહક સેવા કેન્દ્ર,લક્ષ્મણનગર,અંકલેશ્વર ખાતે ગયેલ પંજાબ બેંકમાં મારૂ તથા મારી માસી બબીતાબેન પાઠક નાઓનુ એકાઉન્ટ ખોલાવેલ હતુ.જે બાદ  અને તેના પંદરેક દિવસ પહેલા મેં તથા બબીતાબેને એરટેલના બે નવા સીમકાર્ડ લીધેલા હતા અને તે નંબર બેંકમાં આપેલ હતો ત્યારબાદ અમારા ઘરે ટપાલ મારફતે પાસબુક તથા એ.ટી.એમ. આવેલ જે બંન્ને કીટ લઇને હુ રાજપીપળા ચોકડી ખાતે રોડ પર ગયેલ અને ત્યાં કોઇ અજાણ્યો માણસ આવેલ જેને મેં મારી તથા માસીની બેંક પાસબુકો,એ.ટી.એમ.,સીમકાર્ડ તેને આપી દીધેલ હતુ જે બાદ થોડા દિવસ પછી આ દિનેશનો મારા દિકરા પર ફોન આવેલ અને રૂપીયા લેવા રાજપીપળા ચોકડી ખાતે બોલાવેલ જેથી હુ ત્યાં ગયેલ અને જ્યાં કોઇ અજાણ્યા માણસે મને રૂપીયા ૩૦૦૦/- આપેલા અને બાકીના ૭,૦૦૦/- પછીથી આપવાનુ જણાવેલ હતુ અને આ પૈસા મેં જ રાખી લીધેલા હતા અને માસી બબીતાને આપેલા નહી અને આ દિનેશ અમારા એકાઉન્ટોનુ સુ કરેલ છે તેની મને કોઇ માહીતી નથી એટલી મારી હકીકત મારા લખાવ્યા મુજબ બરાબર અને ખરી છે.\n', NULL, NULL, '૩૦', '૩૨', '૨૨૨૨', 'વારંવાર રહેવાની જગ્યાઓ', '2025-07-14 02:53:49', '2025-07-15 06:32:50');
